import { Stack, Typography } from "@mui/material"
import AddIcon from '@mui/icons-material/Add';

const Sidebar = () => {
  return (
    <div style={{backgroundColor: 'red', height: '100vh', width: '15%', zIndex: '100', position:'absolute'}}>
      <div style={{display: 'flex', marginLeft: '10px', marginRight: '10px', marginTop: '10px', justifyContent: 'space-between', alignItems: 'center'}}>
        <h1 style={{margin: 0}}>Notes</h1>
        <AddIcon style={{border: '2px solid black', borderRadius: '50%', backgroundColor: "white", display: "flex", alignItems: 'center', display: 'inline'}}/>
      </div>
    </div>
  )
}

export default Sidebar
